document.getElementById("switch").addEventListener("change", changeSimu);
var tour = simulation1.split("#");

function changeSimu(){
	n = 1;
	if(document.getElementById("checkbox").checked){
		tour = simulation2.split("#");
		document.getElementById('nomSimulation').innerHTML = "Simuation numéro 2";
	} else {
		tour = simulation1.split("#");
		document.getElementById('nomSimulation').innerHTML = "Simuation numéro 1";
	}
}

//Pour chaque tour
setInterval(faireTour, 1000);

function faireTour(){
	
	ctx.beginPath();
	ctx.clearRect(0, 0, 800, 800);
	ctx.closePath();
	
	var tmp = tour[n];
	var perso = tmp.split(":");
	
	for(var j = 0; j < perso.length-1; j++){
		var tmp2 = perso[j];
		stat = tmp2.split(",");
		ctx.beginPath();
		var x = 4* Math.round(stat[4]);
		var y = 4* Math.round(stat[5]);	
		if (stat[1] == 0) {
			//Gentil
			
			ctx.arc(x, y, 10, 0, 2 * Math.PI);
			ctx.fillStyle = "#00FF00";
			ctx.fill();
		} else {
			//Méchant
			if(stat[2]=="Red Great Wyrm Dragon"){
					ctx.arc(x, y, 30, 0, 2 * Math.PI)
					ctx.fillStyle = "#FF8000";
					ctx.fill();

			}else{
				ctx.arc(x, y, 10, 0, 2 * Math.PI)
				ctx.fillStyle = "#FF0000";
				ctx.fill();
			}
					}
		ctx.closePath();
		ctx.beginPath();
		ctx.fillStyle = "#000000";
		ctx.fillText(stat[2],x-9,y);
		ctx.closePath();
		
		
	}
	if(n==tour.length-1){
			n=1;
		} else{
			n=n+1;
		}
}